import styles from "./../assets/components/Service.module.css";

function Service({
    nameService,
    logo,
}){
    function teste(){
        return {width: 50, height: 50};
    }
    return (
        <div className={styles.containerService}>
            <div className={styles.title}>
              <p>{nameService}</p>  
            </div>
            <img 
                src={logo} 
                alt={nameService}
                className={nameService === "MongoDB" ? 
                    teste() : ""}    
            />
        </div>
    )
}

export default Service;
